window.bookSummaryJSON = "<p><b>Forever is such a long time.</b></p> <p>Walter Tye is the best friend any adventurer needs. He is the smiling shopkeeper next to your local dungeon, the one who sells you these cheap healing potions. When you need information, Tye always knows. He wants to help; you can trust him.</p> <p>He is also the undead necromancer ruling said dungeon, getting paid to solve problems that he caused in the first place. But don't tell anyone that....</p> <p>Cover Courtesy of Tapas Media © 2021</p>"; 
